class ShowFull extends React.Component{
    render(){
        return(
            <>
                <div style={{width : '350px',borderRadius: '20px 20px 0 0',backgroundColor: '#00000033'}}>
                    Chung ta da ben nhau...
                </div>
            </>
        )
    }
}

export default ShowFull;
